// import logo from "./logo.svg";
import React from "react";
import "./App.css";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";

class App extends React.Component {
  constructor(props) {
    super();
    this.state = {
      id: 1,
      title: "buttermilk pancakes",
      category: "breakfast",
      price: 15.99,
      img: "./images/item-1.jpeg",
      desc: `I'm baby woke mlkshk wolf bitters live-edge blue bottle, hammock freegan copper mug whatever cold-pressed `,
    };
  }
  render() {
    const { title, category, price, img, desc } = this.state;
    //Card component
    return (
      <div>
        <Card sx={{ maxWidth: 345 }}>
          <CardMedia
            sx={{ height: 140 }}
            image="https://i0.wp.com/www.sparklingcharm.com/wp-content/uploads/2020/07/88649DC9-1859-41FE-B373-BDB8EB375582.jpg?resize=768%2C824&ssl=1"
            title="green iguana"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              {title}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {desc}
            </Typography>
            <Typography>{price}</Typography>
            <Typography> Category: {category}</Typography>
          </CardContent>
          <CardActions>
            <Button size="small" onClick={() => console.log("clicked")}>
              Add to card
            </Button>
          </CardActions>
        </Card>
      </div>
    );
  }
}
export default App;
